# HG8010/HG8045 feature.cfg

#feature.attribute用来表示feature的属性，目前主要用来表示该特性是否可以运营商二次定制，最低位为1表示可以定制，0表示不可定制
#HW_VSPA_FEATURE_VoIP 控制是否支持语音特性
feature.name = "HW_VSPA_FEATURE_VOIP" feature.enable="0" feature.attribute="0"
#VOICE_FT_WEB_PBXPrefix 四川二级数图特性
feature.name = "VOICE_FT_WEB_PBXPrefix" feature.enable="0" feature.attribute="0"


